def handleFirst(currentNum,right):
	if currentNum > right:
		return 2
	return 1

def handleMidCases(currentNum, left, right, candies):
	if currentNum > left and currentNum > right:
		return candies[len(candies) - 1] + 1
	elif currentNum == left and currentNum == right:
		return 1
	elif currentNum < left and currentNum > right:
		if candies[len(candies) - 1] == 2:
			candies[len(candies) - 1] += 1
		return 2
	elif currentNum < left and currentNum < right:
		return 1
	elif currentNum == left and currentNum > right:
		return 2
	elif currentNum == left and currentNum < right:
		return 1
	elif currentNum < left and currentNum == right:
		return 1
	elif currentNum > left and currentNum < right:
		return candies[len(candies) - 1] + 1
	elif currentNum > left and currentNum == right:
		return candies[len(candies) - 1] + 1
	else:
		return 0

def handleLast(currentNum, left, candies):
	if currentNum > left:
		return candies[len(candies) - 1] + 1
	return 1

# Complete the candies function below.
def candies(n, arr):
	totalCandies = []
	for i in range(n):
		left = 0
		right = 0
		currentNum = arr[i]
		if i > 0:
			left = arr[i - 1]
		if i < len(arr) - 1:
			right = arr[i + 1]
		if left == 0:
			candy = handleFirst(currentNum, right)
			totalCandies.append(candy)
		elif right == 0:
			candy = handleLast(currentNum, left, totalCandies)
			totalCandies.append(candy)
		else:
			candy = handleMidCases(currentNum, left, right, totalCandies)
			totalCandies.append(candy)
	#Handle repeating 3s caused by consecutive occurence of currentNum < left and currentNum > right
	for i in range(1,n):
		if totalCandies[i] <= totalCandies[i - 1] and arr[i] > arr[i - 1]:
			totalCandies[i] = totalCandies[i - 1] + 1
	for i in range(n-2,-1,-1):
		if totalCandies[i] <= totalCandies[i + 1] and arr[i] > arr[i + 1]:
			totalCandies[i] = totalCandies[i + 1] + 1
	return sum(totalCandies)
	
