#Expects 161282 for arr2 -- getting 160313 -- difference 969
def correctSolution(n, arr):
	dp =[1]*n
	for i in range(1,n):
		if arr[i] > arr[i-1]:
			dp[i] = dp[i]+dp[i-1]
	for i in range(n-2,-1,-1):
		if arr[i]>arr[i+1] and dp[i] <= dp[i+1]:
			dp[i]= dp[i+1]+1
	return sum(dp)

